import React from 'react';

const Feature = () => {
    return (
        <div className='gpt3__features section__padding' id="features">
            <div className='gpt3__featuree-header'>
                <h1 className='gradient__text'>The futur is now andyou just need to realize it. Step into the futur today & Make it Happen.</h1>
                <p>Request early to get started</p>
            </div>
        </div>
    );
};

export default Feature;
